import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart';
import LabForm from './components/LabForm';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import AvgChart from './components/AvgChart';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      ics: [],
      ews: [],
      isLoaded: false,
      stackedICSData:{},
      stackedEWSData:{},
      currLab:"",
      labAverages:{},
      lineAvgs:{},
    }
  }

  componentDidMount() {
    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "https://69smoo2dc6.execute-api.us-east-1.amazonaws.com/api/ics";
    const url2 = "https://69smoo2dc6.execute-api.us-east-1.amazonaws.com/api/ews";
    const url3 = "https://pzgw0wp7ch.execute-api.us-east-1.amazonaws.com/default/getAverageCompLab";
    Promise.all([fetch(proxyurl + url), fetch(proxyurl + url2), fetch(proxyurl + url3)])
      .then(([res1, res2, res3]) => Promise.all([res1.json(), res2.json(), res3.json()]))
      .then(([data1, data2, data3]) => {
        var ics_actives = [];
        var ics_availables = [];
        var ics_names = [];
        data1.map(item => (
          ics_actives.push(item["usage_active"]),
          ics_availables.push(item["usage_total"] - item["usage_active"]),
          ics_names.push(item["site_displayname"])
        ));
        var ews_actives = [];
        var ews_availables = [];
        var ews_names = [];
        data2.map(item => (
          ews_actives.push(item["inusecount"]),
          ews_availables.push(item["machinecount"] - item["inusecount"]),
          ews_names.push(item["strlabname"])
        ));
        this.setState({
          labAverages: data3,
          isLoaded: true,
          ics: data1,
          ews: data2,
          stackedICSData: {
            labels: ics_names,
            datasets: [
              {
                label:'In Use',
                data: ics_actives,
                backgroundColor: 'rgba(200, 100, 100, .6)'
              },
              {
                label:'Available',
                data: ics_availables,
                backgroundColor: 'rgba(100, 200, 100, .6)'
              }
            ],
          },
          stackedEWSData: {
            labels: ews_names,
            datasets: [
              {
                label:'In Use',
                data: ews_actives,
                backgroundColor: 'rgba(200, 100, 100, .6)'
              },
              {
                label:'Available',
                data: ews_availables,
                backgroundColor: 'rgba(100, 200, 100, .6)'
              }
            ],
          }
        })
      });
  }

  render() {

    var { ics, ews, isLoaded, stackedICSData, stackedEWSData, test, labAverages } = this.state;
    var stackedOptions = {
      scales: {
        xAxes: [{
          stacked: true ,
          ticks: {
            display: true,
            autoSkip: false
          }
        }],
        yAxes: [{ stacked: true }]
      },
    };
    if (!isLoaded) {
      return <div>
        Loading data...
        <img src="https://srtilab.techservices.illinois.edu/wp-content/uploads/elementor/thumbs/Jarrett-Headshot-o4fkvjmsystpckutr7vnjy6wkzb5noe3po1ioi815c.jpg" alt="SRTI Student" width="1000" height="1000"/>
      </div>;
    } else {
      return (
        <div className="App">
          <div class="nav_container">
            <Navbar bg="dark" variant="dark">
              <Navbar.Brand href="#home">Lab Usage Data</Navbar.Brand>
              <Nav className="mr-auto">
                <Nav.Link href="https://techservices.illinois.edu/content/computer-lab-locations-and-hours">ICS</Nav.Link>
                <Nav.Link href="https://it.engineering.illinois.edu/ews">EWS</Nav.Link>
                <Nav.Link href="https://srtilab.techservices.illinois.edu/">SRTI</Nav.Link>
              </Nav>
            </Navbar>
          </div>
          <div class="chart_title">ICS (Instructional Computing Services)</div>
          <div class="chart_container">
            <Chart chartData={this.state.stackedICSData} chartOptions={stackedOptions} />
          </div>
          <div class="chart_title">EWS (Engineering Workstations)</div>
          <div class="chart_container">
            <Chart chartData={this.state.stackedEWSData} chartOptions={stackedOptions} />
          </div>
          <div class="chart_container">
            <AvgChart chartData={this.state.stackedEWSData} />
          </div>
          <LabForm />

        </div>
      );
    }
  }
}

export default App;
